            <div className="flex flex-col gap-3">
                {teamsForm.map((match, index) => (
                    <div key={index} className="flex gap-2 items-center">
                        <img className="h-5 w-5" src={`https://images.fotmob.com/image_resources/logo/leaguelogo/${match?.primaryId}.png`} alt="team1Logo"></img>
                    </div>
                ))}
            </div>
        </div>
    )
} 

